/**
 * Check highlightSymbol for the Maps
 *
 * @param status - Inspection status
 * @returns highlightSymbol
 */
export const highlightSymbol = status => {
  let highlightIcon = {
    url: '',
    color: '',
    offsetx: 13,
    offsety: 24,
    width: 36,
    height: 48
  };

  let symbolURL = null;

  switch (status) {
    case 'PENDING':
      symbolURL = pendingHighlightURL;
      break;
    case 'INPROG':
      symbolURL = inProgHighlightURL;
      break;
    case 'COMPLETED':
      symbolURL = completedHighlightURL;
      break;
    case 'CLUSTER':
      symbolURL = clusterHighlightURL;
      break;
    default:
      symbolURL = defaultHighlightURL;
  }

  highlightIcon.url = symbolURL;

  if (status === 'CLUSTER') {
    highlightIcon.offsetx = 12;
    highlightIcon.offsety = 36;
    highlightIcon.width = 36;
    highlightIcon.height = 36;
  }

  return highlightIcon;
};

/**
 * Check mapSymbol for the Maps
 *
 * @param status - Inspection status / or 'CLUSTER' for cluster icons
 * @returns mapSymbol
 */
export const mapSymbol = status => {
  let symbol = {
    url: '',
    color: '',
    offsetx: 13,
    offsety: 24,
    width: 36,
    height: 48
  };

  let symbolURL = null;

  switch (status) {
    case 'PENDING':
      symbolURL = pendingURL;
      break;
    case 'INPROG':
      symbolURL = inProgURL;
      break;
    case 'COMPLETED':
      symbolURL = completedURL;
      break;
    case 'CLUSTER':
      symbolURL = clusterURL;
      break;
    default:
      symbolURL = defaultURL;
  }
  symbol.url = symbolURL;
  if (status === 'CLUSTER') {
    symbol.offsetx = 12;
    symbol.offsety = 36;
    symbol.width = 36;
    symbol.height = 36;
  }

  return symbol;
};

export const getMapDimension = (device) => {
  let mapHeight = "calc(100vh - 9.1rem)";
  let mapDialogHeight = "calc(100vh - 6rem)";

  //list can have multiple items, define a height
  let mapListHeight = "40%";

  //for desktop and tablet height auto and disable scroll
  let mapCardHeight = "auto";
  let mapCardScroll = false;

  let mapPaddingRight = "1.5rem";
  let mapPaddingLeft = "1.5rem";

  if (device.screen.size === 'md') {
    mapListHeight = "30%";
    mapPaddingRight = "1rem";
    mapPaddingLeft = "1rem";
  }

  if (device.isMaximoMobile || device.screen.size === 'sm') {
    mapPaddingRight = "0";
    mapPaddingLeft = "0";
    mapHeight = "calc(100vh - 5.1rem)";
    mapDialogHeight = "calc(100vh - 5.5rem)";

    mapListHeight = "35%";

    //for mobile define a height and enable scroll
    mapCardHeight = "35%";
    mapCardScroll = true;
  } 
  return {
    mapPaddingBottom: "0",
    mapPaddingRight: mapPaddingRight,
    mapPaddingLeft: mapPaddingLeft,
    mapHeight: mapHeight,
    mapDialogHeight: mapDialogHeight,
    mapListHeight: mapListHeight,
    mapCardHeight: mapCardHeight,
    mapCardScroll: mapCardScroll
  }
}

/**
 * Return legends for the Layers Tool in the Maps
 *
 * @returns legends
 */
export const mapLegends = (app) => {
  const pinSize = {
    width: 24,
    height: 46,
    offsetx: 13,
    offsety: 24
  };

  const clusterPinSize = {
    width: 44,
    height: 46,
    offsetx: 24,
    offsety: 36
  };

  const legends = {
    Cluster: {
      label: app.getLocalizedLabel('cluster', 'Cluster'),
      url: clusterURL,
      ...clusterPinSize
    },
    INPROG: {
      label: app.getLocalizedLabel('inprog', 'In Progress'),
      url: inProgURL,
      ...pinSize
    },
    PENDING: {
      label: app.getLocalizedLabel('pending', 'Pending'),
      url: pendingURL,
      ...pinSize
    },
    COMPLETED: {
      label: app.getLocalizedLabel('completed', 'Completed'),
      url: completedURL,
      ...pinSize
    }
  };

  return legends;
};

